var tjo={'a':'{{','b':'}}',}
function templatingJS(fileName,tjv,dom){let c=new XMLHttpRequest();c.onreadystatechange=function(){if(c.readyState===c.DONE){if(c.status===200){let d=document.getElementById(dom);d.innerHTML+=tjpf(c.responseText,tjv)}}};c.open('GET',fileName,!0);c.send()}
function tjpf(t,tjv){let h=Object.keys(tjv);let f=tjsp(tjv,h);for(let i=0;i<f.length;i++){let g=new RegExp(f[i],'g')
t=t.replace(g,tjv[h[i]])}
return t}
function tjsp(tjv,keys){let f=[];for(let i=0;i<keys.length;i++){f.push(tjo.a+keys[i]+tjo.b)}
return f}
function changeToken(s,e){tjo.a=s;tjo.b=e}